webpackJsonp([0xf927f8900006],{279:function(e,n){e.exports={data:{site:{siteMetadata:{title:"Annalisa Valente"}},contentfulPageSelectorPanel:{pages:[{name:"Brave the Shave",title:null,slug:"/projects/macmillan",description:"Redesigning Brave the Shave microsite"},{name:"Mindfulness Moments",title:"Mindfulness Moments",slug:"/projects/mindfulness-moments",description:"Building a new fundraising proposition"},{name:"Local Cancer Intelligence",title:"Local cancers intelligence",slug:"/projects/new-page",description:"New filter system for the LCI website"},{name:"Google",title:"Google",slug:"/projects/google/",description:"Interaction designer contractor in the Google Play Console team"},{name:"The Telegraph",title:"The Telegraph",slug:"/projects/thetelegraph/",description:"Working on various digital newspaper touch points"},{name:"The Telegraph puzzle ",title:null,slug:"/projects/the-telegraph-puzzle/",description:"Redesign the experience of the Telegraph puzzle website"},{name:"Nectar ",title:"Nectar",slug:"/projects/nectar/",description:"  Delivering a new personalised user experience on Nectar web and iOS-Android app."},{name:"MyMail & Nectar",title:"MyMail & Nectar",slug:"/projects/mymail-and-nectar/",description:"Launch of MyMail and Nectar proposition"},{name:"Remembering a name and a face",title:null,slug:"/projects/face-name/",description:"Concept of an android experience that helps to match faces to names."}]},contentfulPage:{slug:"/about/",password:null,panels:[{__typename:"ContentfulImagePanel",fullWidth:!1,media:{description:"Testing description",file:{url:"//images.ctfassets.net/wk0hltq7eofw/6dUxyw49e8mOWoOQowguMs/bb1f85747295616bed8d84378915a2fc/g__1_.jpg"}}},{__typename:"ContentfulContentPanel",content:{content:"__Key points of my design experience:__\n\n- Design thinking approach, always user first\n- Web and Mobile experience\n- Shipping large scale projects\n- Working closely with stakeholders, eng, PO, marketers, helping them to ship products and to prioritise features\n- Fast mocking, prototyping and testing approach in order to collect feedback at the early stage of the process and iterate\n- Believing that communication and decision making are the key to make great team and help team member to build great products\n\nMy UI and UX background allows me to work on the most complex design challenges helping companies to launch products delivering the best in class user experience. Working closely with stakeholders and developers I help the teams to identify constrains at the very beginning. I'm able to organise design sprints and workshops helping stakeholders to identify design opportunities.\n\n__My interests:__\n\nOutside the office I am busy reading, studying and working on projects regarding design and development. I am very interested in ethics of information and design, accessibility, inclusive design. \n\nI am a member of the Jury at [www.cssdesignawards.com](https://www.cssdesignawards.com/) and sometimes I like to write articles and to partecipate at hackathons. I'm also helping at the [UXPA UK](https://uxpa-uk.org/).\n\nIn my free time I like playing D&D, board games and learning drums.",childMarkdownRemark:{html:'<p><strong>Key points of my design experience:</strong></p>\n<ul>\n<li>Design thinking approach, always user first</li>\n<li>Web and Mobile experience</li>\n<li>Shipping large scale projects</li>\n<li>Working closely with stakeholders, eng, PO, marketers, helping them to ship products and to prioritise features</li>\n<li>Fast mocking, prototyping and testing approach in order to collect feedback at the early stage of the process and iterate</li>\n<li>Believing that communication and decision making are the key to make great team and help team member to build great products</li>\n</ul>\n<p>My UI and UX background allows me to work on the most complex design challenges helping companies to launch products delivering the best in class user experience. Working closely with stakeholders and developers I help the teams to identify constrains at the very beginning. I\'m able to organise design sprints and workshops helping stakeholders to identify design opportunities.</p>\n<p><strong>My interests:</strong></p>\n<p>Outside the office I am busy reading, studying and working on projects regarding design and development. I am very interested in ethics of information and design, accessibility, inclusive design. </p>\n<p>I am a member of the Jury at <a href="https://www.cssdesignawards.com/">www.cssdesignawards.com</a> and sometimes I like to write articles and to partecipate at hackathons. I\'m also helping at the <a href="https://uxpa-uk.org/">UXPA UK</a>.</p>\n<p>In my free time I like playing D&#x26;D, board games and learning drums.</p>'}}}]}},pathContext:{slug:"/about/",p:"35675e68f4b5af7b995d9205ad0fc43842f16450"}}}});
